import React from 'react';
import { View, Text } from 'react-native';

const Chat = ({ route }) => {
  const { userId, userName } = route.params;

  return (
    <View>
      <Text>{`Chat with ${userName} (ID: ${userId})`}</Text>
      {/* Hiển thị nội dung chat và các thành phần khác */}
    </View>
  );
};

export default Chat;
